import React from 'react';
import Menu from './components/menu'
import Footer from './components/footer'
import Contact from './components/contact'
import './App.css';


function App(){
  return (
    <div>
      <Menu></Menu> 
      <Footer></Footer>
      <Contact></Contact>
    </div>
  );
}

export default App;
